import "./App.css";
const App = () => {
  return (
    <div className="container">
      <div className="inner-container">
        <h1>BUDGET TRACKER</h1>

        <div className="bal">
          <h2>Balance</h2> <hr />
          <h2 className="bal-amount">£0.00</h2>
        </div>

        <div className="inc-exp">
          <div className="inc">
            <h2>Income</h2>
            <h2>+£0.00</h2>
          </div>

          <div className="exp">
            <h2>Expenses</h2>
            <h2>-£0.00</h2>
          </div>
        </div>
      </div>
    </div>
  );
};

export default App;
